import React, { Component } from 'react';

import List from './List';

export default class KanbanBoard extends Component {
    constructor(props){
        super(props);

        this.state = {
            cards: []
        }
    }
    render() {
        return(
            <div>
                <List 
                    id="1" 
                    title="To Do"
                    cards={this.state.cards.filter(card => card === "todo")} />
                <List 
                    id="2" 
                    title="In Progress"
                    cards={this.state.cards.filter(card => card === "inprogress")} />
                <List 
                    id="3" 
                    title="Completed"
                    cards={this.state.cards.filter(card => card === "completed")} />
            </div>
        )
    }
}
